import React from "react";

// Import components
import Todo from "./"
function TodoList( {inputText} ){
  return(
    <div className="todo-container">
      <ul className="todo-list">
        <li>{inputText}</li>        
      </ul>
    </div>
  )
}

export default TodoList;
